  static Future<List<TmsShipmentModel<T>>> get<T>({
    String token,
    String url,
    ChildReader<T> childReader,
  }) {
    NetworkUtil _netUtil = new NetworkUtil();
    return _netUtil.post(url, headers: {
      "lang": "${System.data.resource.lang}",
      HttpHeaders.authorizationHeader: "bearer $token",
      HttpHeaders.contentTypeHeader: "application/json",
    }).then((onValue) {
      return ((json.decode(onValue.toString())) as List)
          .map(
            (f) => TmsShipmentModel.fromJson<T>(
              f,
              childReader: (data) => childReader(data),
            ),
          )
          .toList();
    }).catchError((onError) {
      throw onError;
    });
  }

